function charge() {
    game.targetArrow.alpha = 1;
    game.startTouchX = stage.mouseX;
    game.startTouchY = stage.mouseY;
    game.oldPercent = game.currentPercent;
    if (1 == game.currentWeapon && 1 <= game.grenade_1_count || 2 == game.currentWeapon && 1 <= game.grenade_2_count) heroShootState(), game.gunPower = 0, game.charging = 1, stage.addEventListener("pressup", shoot)
}

function shoot(d) {
    game.targetArrow.alpha = 0;
    switch (game.currentWeapon) {
        case 1:
            game.grenade_1_count--;
            break;
        case 2:
            game.grenade_2_count--
    }
    updateSteps();
    game.charging = 0;
    bodyDef.type = b2Body.b2_dynamicBody;
    fixDef.shape = new b2CircleShape(28 / ppm / 2);
    d = game.hero.localToGlobal(game.heroGun.x, game.heroGun.y);
    bodyDef.position.x = (d.x + 90 * Math.cos(game.gunAngle)) / ppm;
    bodyDef.position.y = (d.y - 35 + 80 * Math.sin(game.gunAngle)) / ppm;
    d = game.world.CreateBody(bodyDef);
    var b = {};
    switch (game.currentWeapon) {
        case 1:
            b._graphic =
                new createjs.Bitmap(preload.getResult("grenade_1"));
            b._graphic.regX = b._graphic.regY = 12;
            startGrenadeTimer(d);
            break;
        case 2:
            b._graphic = new createjs.Container;
            var a = new createjs.Sprite(grenade_2_SpriteSheet);
            a.regX = a.regY = 13;
            b._graphic.addChild(a);
            var e = new createjs.Shape((new createjs.Graphics).beginFill("#000000").drawCircle(0, 0, 35));
            e.alpha = 0.01;
            b._graphic.addChild(e);
            b._graphic.addEventListener("click", detonateGrenade);
            a.gotoAndPlay("run")
    }
    blocksContainer.addChild(b._graphic);
    b.id = "bullet";
    b.removed = !1;
    d.SetUserData(b);
    d.CreateFixture(fixDef);
    game.gunPower += 5;
    d.ApplyImpulse(new b2Vec2(Math.cos(game.gunAngle) * game.gunPower / 2.5, Math.sin(game.gunAngle) * game.gunPower / 2.5), d.GetWorldCenter());
    game.grenade_1 = d;
    game.grenadesArray.push(d);
    stage.removeEventListener("pressup", shoot);
    game.heroGun.anim.addEventListener("animationend", stopGunAnimation);
    game.heroGun.anim.gotoAndPlay("run")
}

